// src/pages/Resume.js
import React from 'react';

function Resume() {
  return (
    <div className="resume">
      <h2>Resume</h2>
      <p>Download my resume below:</p>
      <a href="/path-to-your-resume.pdf" download>Download Resume</a>
    </div>
  );
}

export default Resume;
